import './css/style.css';
import Header from './components/header'
import Banner from './components/banner';
import ItemContent from './components/content';
import Footer from './components/footer';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header/>
        <Banner/>
        {/* <ItemContent/> */}
        {/* <Footer/> */}
      </div>
    );
  }
}

export default App;
